import React, { useEffect, useState } from 'react';

let authInfo = {
  token: '',
  server: '',
};

const FormDisplay = () => {
  const [status, setStatus] = useState('Idle');

const fetchAuthInfo = async () => {
  try {
    // Hardcode temporarily for testing
    authInfo = {
      token: 'qiwPrSCLxVf1twsT05kfUsA3O5HdgoElsVyTvwZJIDk=',
      server: '/proxy',
    };
    setStatus('Auth info loaded');
  } catch (err) {
    console.error('❌ Auth fetch failed:', err);
    setStatus('Failed to load auth info');
  }
};


  const createContainer = async () => {
    setStatus('Creating container...');
    try {
      const response = await fetch(`${authInfo.server}/rest/container`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'ph-auth-token': authInfo.token,
        },
        body: JSON.stringify({
          name: 'Test Container from UI',
          label: 'event_data',
          description: 'This container was created from the UI via proxy.',
        }),
      });

      const text = await response.text();
      if (!response.ok) {
        throw new Error(`Failed to create container: ${response.status} ${text}`);
      }

      const data = JSON.parse(text);
      console.log('✅ Container created:', data);
      setStatus(`Container created (ID: ${data.id})`);
    } catch (err) {
      console.error('❌ createContainer failed:', err);
      setStatus('Container creation failed');
    }
  };

  useEffect(() => {
    fetchAuthInfo();
  }, []);

  return (
    <div style={{ padding: '2rem' }}>
      <h2>Test Container Creation</h2>
      <button onClick={createContainer}>Create Container</button>
      <p>Status: {status}</p>
    </div>
  );
};

export default FormDisplay;
